import React, { Component } from "react";
import Project from "./project";

class Projects extends Component {
  constructor() {
    super();
    this.state = {
      people: []
    };
  }

  componentDidMount() {
    fetch("https://randomuser.me/api/?results=5");
  }

  state = {
    projectList: [
      {
        uid: "0",
        shortname: "salespath"
      },
      {
        uid: "1",
        shortname: "grubhub"
      },
      {
        uid: "2",
        shortname: "gospace"
      }
    ]
  };
  render() {
    return this.state.projectList.map(p => <Project project={p} />);
  }
}

export default Projects;
